func minimumCost(source string, target string, original []string, changed []string, cost []int) int64 {
    // Map to store minimum cost to change a string from original to changed
    changeCost := make(map[string]int64)
    for i, o := range original {
        c := changed[i]
        // Key for the map
        key := o + "->" + c
        if val, ok := changeCost[key]; !ok || val > int64(cost[i]) {
            changeCost[key] = int64(cost[i])
        }
    }

    n := len(source)
    m := len(target)

    // dp array to store the minimum cost to change source[0...i] to target[0...j]
    dp := make([][]int64, n+1)
    for i := range dp {
        dp[i] = make([]int64, m+1)
        for j := range dp[i] {
            dp[i][j] = 1e18 // Initialize with a large value
        }
    }

    dp[0][0] = 0 // No cost to change empty string to empty string

    for i := 0; i <= n; i++ {
        for j := 0; j <= m; j++ {
            // If both characters are same, no cost to change
            if i < n && j < m && source[i] == target[j] {
                dp[i+1][j+1] = min(dp[i+1][j+1], dp[i][j])
            }
            // Try changing source[i...k] to target[j...l] for all possible k and l
            for k := i; k < n; k++ {
                for l := j; l < m; l++ {
                    orig := source[i : k+1]
                    chng := target[j : l+1]
                    key := orig + "->" + chng
                    if cost, ok := changeCost[key]; ok {
                        dp[k+1][l+1] = min(dp[k+1][l+1], dp[i][j]+cost)
                    }
                }
            }
        }
    }

    if dp[n][m] == 1e18 {
        return -1
    }
    return dp[n][m]
}

func min(a, b int64) int64 {
    if a < b {
        return a
    }
    return b
}
